{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/zsetash/cyclistic-bikeshare-case-study?scriptVersionId=137501390\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Introduction\n\nCyclistic is a (fictional) bikeshare company based in Chicago.  Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.The marketing director has set the goal of converting existing casual users into annual members. The data for this analysis is provided [here](https://divvy-tripdata.s3.amazonaws.com/index.html). My analysis is focusing on the time frame of July 2022 - June 2023. In order to guide business decisions, I am focusing on a singular question:\n\nHow do annual **members** and **casual** riders use Cyclistic bikes differently?\n\n# Preparing Data\n\n### Limitations\n\nThe current data records rides, not riders. I do not have information to compare how many times a specific rider uses the service. I also do not have any information about the cost of the rides. The best way to convince people to sign up for a membership is to convince them that it is the more cost effective choice. I do not currently know how the cost for the customes varies across the different passes.\n\n## Cleaning Data\n\nPrior to importing the data into R, I made some cleaning adjustments. I verified that the column names were consistent across files. I added the column *ride_length* using the difference between the columns *ended_at* and *started_at* in order to later learn more about the differences in ride lengths between users. I also added a *day_of_week* column using the WEEKDAY function in order to later compare usage across days of the week.\n\n### Importing Packages and Data","metadata":{"execution":{"iopub.status.busy":"2023-07-20T21:07:34.309549Z","iopub.execute_input":"2023-07-20T21:07:34.312164Z","iopub.status.idle":"2023-07-20T21:07:34.457608Z"},"_kg_hide-output":false}},{"cell_type":"code","source":"install.packages(\"tidyverse\")\ninstall.packages(\"chron\")\nlibrary(tidyverse)\nlibrary(ggplot2)\nlibrary(dplyr)\nlibrary(lubridate)\nlibrary(hms)\nlibrary(chron)","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2023-07-21T18:47:33.856721Z","iopub.execute_input":"2023-07-21T18:47:33.858219Z","iopub.status.idle":"2023-07-21T18:47:57.452783Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"july <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202207-divvy-tripdata.csv\")\naugust <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202208-divvy-tripdata.csv\")\nseptember <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202209-divvy-tripdata.csv\")\noctober <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202210-divvy-tripdata.csv\")\nnovember <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202211-divvy-tripdata.csv\")\ndecember <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202212-divvy-tripdata.csv\")\njanuary <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202301-divvy-tripdata.csv\")\nfebruary <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202302-divvy-tripdata.csv\")\nmarch <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202303-divvy-tripdata.csv\")\napril <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202304-divvy-tripdata.csv\")\nmay <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202305-divvy-tripdata.csv\")\njune <- read_csv(\"/kaggle/input/bikeshare-cyclistic/202306-divvy-tripdata.csv\")","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2023-07-21T18:47:57.456413Z","iopub.execute_input":"2023-07-21T18:47:57.458003Z","iopub.status.idle":"2023-07-21T18:48:14.64269Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"I then combined the data into a single dataframe, to better see overall trends.","metadata":{}},{"cell_type":"code","source":"year <- rbind(january, february, march, april, may, june, july, august, september, october, november, december)","metadata":{"execution":{"iopub.status.busy":"2023-07-21T18:48:14.645435Z","iopub.execute_input":"2023-07-21T18:48:14.646919Z","iopub.status.idle":"2023-07-21T18:48:22.424832Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"I then removed any duplicate rows based on the ride ID.","metadata":{}},{"cell_type":"code","source":"year_no_dup <- year %>% \n  distinct(ride_id, .keep_all = TRUE)\n\nprint(paste(\"Removed\", nrow(year) - nrow(year_no_dup), \"duplicated rows\"))","metadata":{"execution":{"iopub.status.busy":"2023-07-21T18:48:22.42764Z","iopub.execute_input":"2023-07-21T18:48:22.429176Z","iopub.status.idle":"2023-07-21T18:48:24.156935Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"I then removed any rows that contained NA values.","metadata":{}},{"cell_type":"code","source":"year_clean <- drop_na(year_no_dup)\n\nprint(paste(\"Removed\", nrow(year_no_dup) - nrow(year_clean), \"rows with NA values\"))","metadata":{"execution":{"iopub.status.busy":"2023-07-21T18:48:24.159611Z","iopub.execute_input":"2023-07-21T18:48:24.161056Z","iopub.status.idle":"2023-07-21T18:48:25.504027Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Data Transformation\n\nI used existing values to create several columns to streamline my workflow. First, I created a column that displayed the length of the bike rides in minutes by finding the difference between the starting and ending times.","metadata":{}},{"cell_type":"code","source":"year_clean <- year_clean %>%\n  mutate(ride_time_minutes = as.numeric(year_clean$ended_at - year_clean$started_at) / 60)\nprint(summary(year_clean$ride_time_minutes))","metadata":{"execution":{"iopub.status.busy":"2023-07-21T18:48:25.507878Z","iopub.execute_input":"2023-07-21T18:48:25.509869Z","iopub.status.idle":"2023-07-21T18:48:25.935528Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Through the summary, I discovered that the data set included impossible ride times. There were instances where the ride ended before it started. There were also times that were too short to be actual rides. I removed these values to focus the analysis on more authentic ride times.","metadata":{}},{"cell_type":"code","source":"year_clean_times <- year_clean %>% \n  filter(ride_time_minutes > 2) \nprint(paste(\"Removed\", nrow(year_clean) - nrow(year_clean_times), \"rows with impossible or inauthentic values\"))","metadata":{"execution":{"iopub.status.busy":"2023-07-21T18:48:25.939487Z","iopub.execute_input":"2023-07-21T18:48:25.941693Z","iopub.status.idle":"2023-07-21T18:48:28.298332Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"I then added columns that documented the day of the week of the ride start times. I also added a column that gave the start times a \"time of day\", splitting the times into morning, afternoon, evening, and night.","metadata":{}},{"cell_type":"code","source":"year_clean_times <- year_clean_times %>% \n  mutate(day_of_week = wday(started_at, label = TRUE))\n\nbreaks <- hour(hm(\"00:00\", \"4:00\", \"12:00\", \"19:00\", \"23:00\"))\nlabels <- c(\"Night\", \"Morning\", \"Afternoon\", \"Evening\")\n\nyear_clean_times$time_of_day <- cut(x=hour(year_clean_times$started_at), breaks = breaks, labels = labels, include.lowest=TRUE)","metadata":{"execution":{"iopub.status.busy":"2023-07-21T18:48:28.302488Z","iopub.execute_input":"2023-07-21T18:48:28.304652Z","iopub.status.idle":"2023-07-21T18:48:33.416646Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"I then removed any times great than one day and created a column that group the lengths of the rides into more meaningful groups.","metadata":{"execution":{"iopub.status.busy":"2023-07-20T21:32:46.851413Z","iopub.execute_input":"2023-07-20T21:32:46.852452Z","iopub.status.idle":"2023-07-20T21:32:46.880128Z"}}},{"cell_type":"code","source":"year_clean_times2 <- year_clean_times %>% \n  filter(ride_time_minutes <= 1440)\n\nprint(paste(\"Removed\", nrow(year_clean_times) - nrow(year_clean_times2), \"rows with ride duration greater than a day\"))\n\nbreaks2 <- c(2, 5, 10, 20, 60, 360, 720, 1440)\nlabels2 <- c(\"Less than 5 minutes\",\"Between 5 and 10 minutes\", \"Between 10 and 20 minutes\", \"Between 20 minutes and an hour\", \"Between an hour and 6 hours\", \"Between 6 hours and 12 hours\", \"Between 12 hours and a day\")\n\nyear_clean_times2$ride_length <- cut(x=(year_clean_times2$ride_time_minutes), breaks = breaks2, labels = labels2, include.lowest=TRUE, ordered = TRUE)","metadata":{"execution":{"iopub.status.busy":"2023-07-21T19:11:45.802318Z","iopub.execute_input":"2023-07-21T19:11:45.805065Z","iopub.status.idle":"2023-07-21T19:11:48.148734Z"},"trusted":true},"execution_count":84,"outputs":[{"name":"stdout","text":"[1] \"Removed 0 rows with ride duration greater than a day\"\n","output_type":"stream"}]},{"cell_type":"markdown","source":"While not truly necessary, I split the data into two separate data sets, one focuing on the members and the other focusing on the casual riders. ","metadata":{}},{"cell_type":"code","source":"year_member <- year_clean_times2 %>% \n  filter(member_casual == 'member')\n\nyear_casual <- year_clean_times2 %>% \n  filter(member_casual == 'casual')","metadata":{"_kg_hide-input":false,"execution":{"iopub.status.busy":"2023-07-21T19:11:53.157578Z","iopub.execute_input":"2023-07-21T19:11:53.159577Z","iopub.status.idle":"2023-07-21T19:11:53.768936Z"},"trusted":true},"execution_count":85,"outputs":[]},{"cell_type":"code","source":"print(\"Members\")\nglimpse(year_member)\nprint(\"Casual Riders\")\nglimpse(year_casual)","metadata":{"execution":{"iopub.status.busy":"2023-07-21T19:11:59.313852Z","iopub.execute_input":"2023-07-21T19:11:59.316115Z","iopub.status.idle":"2023-07-21T19:11:59.389629Z"},"trusted":true},"execution_count":86,"outputs":[{"name":"stdout","text":"[1] \"Members\"\nRows: 2,613,888\nColumns: 17\n$ ride_id            \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"F96D5A74A3E41399\", \"13CB7EB698CEDB88\", \"C90792D034…\n$ rideable_type      \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"electric_bike\", \"classic_bike\", \"classic_bike\", \"c…\n$ started_at         \u001b[3m\u001b[90m<dttm>\u001b[39m\u001b[23m 2023-01-21 20:05:42, 2023-01-10 15:37:36, 2023-01-…\n$ ended_at           \u001b[3m\u001b[90m<dttm>\u001b[39m\u001b[23m 2023-01-21 20:16:33, 2023-01-10 15:46:05, 2023-01-…\n$ start_station_name \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"Lincoln Ave & Fullerton Ave\", \"Kimbark Ave & 53rd …\n$ start_station_id   \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"TA1309000058\", \"TA1309000037\", \"TA1309000037\", \"TA…\n$ end_station_name   \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"Hampden Ct & Diversey Ave\", \"Greenwood Ave & 47th …\n$ end_station_id     \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"202480.0\", \"TA1308000002\", \"TA1308000002\", \"TA1308…\n$ start_lat          \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 41.92407, 41.79957, 41.79957, 41.79957, 41.92607, 4…\n$ start_lng          \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m -87.64628, -87.59475, -87.59475, -87.59475, -87.638…\n$ end_lat            \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 41.93000, 41.80983, 41.80983, 41.80983, 41.93000, 4…\n$ end_lng            \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m -87.64000, -87.59938, -87.59938, -87.59938, -87.640…\n$ member_casual      \u001b[3m\u001b[90m<chr>\u001b[3