u001b[90m<dbl>\u001b[39m\u001b[23m -87.69941, -87.64000, -87.69941, -87.66972, -87.690…\n$ member_casual      \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"casual\", \"casual\", \"casual\", \"casual\", \"casual\", \"…\n$ ride_time_minutes  \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 13.233333, 9.950000, 15.266667, 7.300000, 10.150000…\n$ day_of_week        \u001b[3m\u001b[90m<ord>\u001b[39m\u001b[23m Mon, Tue, Thu, Mon, Wed, Tue, Fri, Sat, Fri, Sun, T…\n$ time_of_day        \u001b[3m\u001b[90m<fct>\u001b[39m\u001b[23m Morning, Evening, Afternoon, Morning, Afternoon, Af…\n$ ride_length        \u001b[3m\u001b[90m<ord>\u001b[39m\u001b[23m Between 10 and 20 minutes, Between 5 and 10 minutes…\n","output_type":"stream"}]},{"cell_type":"markdown","source":"# Analyzing the Data","metadata":{}},{"cell_type":"markdown","source":"Throughout the course of my analysis, I focused on percentages of riders. My analyis included a million more rides from members than casual riders. Looking at raw numbers and comparing the values using the same y-axis for members and casual riders could be misleading. Since my goal was to determine the differences betweeen the types of riders, I honed in on the proportion of riders within a group, rather then the number of individual riders.\n\n## Day of the Week","metadata":{}},{"cell_type":"code","source":"ggplot(data=year_member) +\n  geom_bar(mapping=aes(x=day_of_week, fill=day_of_week), show.legend = FALSE) +\n  labs(title = \"Days of rides for Members\", x = \"Day of the Week\", y = \"Frequency\", fill = NULL) +\n  theme(axis.text.y = element_blank())+\n  annotate(\"label\", x = \"Sun\", y = 282525, label = \"11%\") +\n  annotate(\"label\", x = \"Mon\", y = 359709, label = \"14%\") +\n  annotate(\"label\", x = \"Tue\", y = 413938, label = \"16%\") +\n  annotate(\"label\", x = \"Wed\", y = 427159, label = \"16%\") +\n  annotate(\"label\", x = \"Thu\", y = 418776, label = \"16%\") +\n  annotate(\"label\", x = \"Fri\", y = 377968, label = \"14%\") +\n  annotate(\"label\", x = \"Sat\", y = 333833, label = \"13%\") ","metadata":{"_kg_hide-input":true,"execution":{"iopub.status.busy":"2023-07-21T18:48:35.722055Z","iopub.execute_input":"2023-07-21T18:48:35.724179Z","iopub.status.idle":"2023-07-21T18:48:42.916767Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"ggplot(data=year_casual) +\n  geom_bar(mapping=aes(x=day_of_week, fill=day_of_week), show.legend = FALSE)+\n  labs(title = \"Days of rides for Casual Riders\", x = \"Day of the Week\", y = \"Frequency\", fill = NULL) +\n  theme(axis.text.y = element_blank()) +\n  annotate(\"label\", x = \"Sun\", y = 259364, label = \"16%\") +\n  annotate(\"label\", x = \"Mon\", y = 183853, label = \"11%\") +\n  annotate(\"label\", x = \"Tue\", y = 184772, label = \"11%\") +\n  annotate(\"label\", x = \"Wed\", y = 199075, label = \"12%\") +\n  annotate(\"label\", x = \"Thu\", y = 213670, label = \"13%\") +\n  annotate(\"label\", x = \"Fri\", y = 247329, label = \"15%\") +\n  annotate(\"label\", x = \"Sat\", y = 339453, label = \"21%\") ","metadata":{"_kg_hide-input":true,"execution":{"iopub.status.busy":"2023-07-21T18:48:42.919936Z","iopub.execute_input":"2023-07-21T18:48:42.921666Z","iopub.status.idle":"2023-07-21T18:48:46.111Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"The most popular days of the week for members are Tuesday, Wedneday, and Thursday, making up a total of 48% of their rides. The most popular days of the week for causual riders are Friday, Saturday, and Sunday, making up a total of 52% of their rides. These differences indicate that members use the bikes for utility purposes while casual riders use the bikes for recreational purposes. \n\n## Duration of Rides","metadata":{}},{"cell_type":"code","source":"ggplot(data=year_member) +\n  geom_bar(mapping=aes(x=ride_length, fill=ride_length)) +\n  labs(title = \"Ride times for Members\", x = NULL, y = \"Frequency\", fill = \"Ride