ABJEOwAAAAkQbADAACQBMEOAABAEgQ7AAAASRDsAAAAJPF/o7X0FqnKRZ4AAAAASUVORK5C\nYII="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"code","source":"ggplot(data=year_casual) +\n  geom_bar(mapping=aes(x=ride_length, fill=ride_length)) +\n  labs(title = \"Ride times for Casual Riders\", x = NULL, y = \"Frequency\", fill = \"Ride time in minutes\") +\n  theme(axis.text.x = element_blank(), axis.text.y = element_blank())+ \n  annotate(\"label\", x = \"Less than 5 minutes\", y = 172658, label = \"11%\") +\n  annotate(\"label\", x = \"Between 5 and 10 minutes\", y = 424441, label = \"26%\") +\n  annotate(\"label\", x = \"Between 10 and 20 minutes\", y = 503743, label = \"31%\") +\n  annotate(\"label\", x = \"Between 20 minutes and an hour\", y = 417796, label = \"26%\") +\n  annotate(\"label\", x = \"Between an hour and 6 hours\", y = 105785, label = \"7%\") +\n  annotate(\"label\", x = \"Between 6 hours and 12 hours\", y = 20000, label = \"<1%\") +\n  annotate(\"label\", x = \"Between 12 hours and a day\", y = 20000, label = \"<1%\") \n","metadata":{"_kg_hide-input":true,"execution":{"iopub.status.busy":"2023-07-21T18:48:46.247512Z","iopub.execute_input":"2023-07-21T18:48:46.249727Z","iopub.status.idle":"2023-07-21T18:48:46.374236Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Members tend to take shorter rides than casual riders. 84% of rides by members were shorter than 20 minutes, whereas only 68% of rides by casual riders were under 20 minutes. Only 1% of rides by members took over an hour, whereas 7% of rides by casual riders took over an hour. \n\nThe most frequent ride duration for members was between 5 and 10 minutes while the most frequent duration for casual riders was between 10 and 20 minutes.\n\n## Bike Type","metadata":{}},{"cell_type":"code","source":"ggplot(data=year_member) +\n  geom_bar(mapping=aes(x=rideable_type, fill=rideable_type), show.legend = FALSE)+\n  labs(title = \"Type of bike used by Members\", x = \"Type of Bike\", y = \"Frequency\", fill = NULL) +\n  scale_x_discrete(labels=c(\"classic_bike\" = \"Classic Bike\", \"docked_bike\" = \"Docked Bike\", \"electric_bike\" = \"Electric Bike\")) +\n  theme(axis.text.y = element_blank())+ \n  annotate(\"label\", x = \"classic_bike\", y = 1629890, label = \"62%\")+ \n  annotate(\"label\", x = \"electric_bike\", y = 984018, label = \"38%\")","metadata":{"_kg_hide-input":true,"execution":{"iopub.status.busy":"2023-07-21T18:48:46.378403Z","iopub.execute_input":"2023-07-21T18:48:46.38055Z","iopub.status.idle":"2023-07-21T18:48:51.002624Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"ggplot(data=year_casual) +\n  geom_bar(mapping=aes(x=rideable_type, fill=rideable_type), show.legend = FALSE)+\n  labs(title = \"Type of bike used by Casual Riders\", x = \"Type of Bike\", y = \"Frequency\", fill = NULL) +\n  scale_x_discrete(labels=c(\"classic_bike\" = \"Classic Bike\", \"docked_bike\" = \"Docked Bike\", \"electric_bike\" = \"Electric Bike\")) +\n  theme(axis.text.y = element_blank())+ \n  annotate(\"label\", x = \"classic_bike\", y = 781314, label = \"48%\")+ \n  annotate(\"label\", x = \"docked_bike\", y = 136788, label = \"8%\")+ \n  annotate(\"label\", x = \"electric_bike\", y = 709414, label = \"44%\")","metadata":{"_kg_hide-input":true,"execution":{"iopub.status.busy":"2023-07-21T18:48:51.005608Z","iopub.execute_input":"2023-07-21T18:48:51.007233Z","iopub.status.idle":"2023-07-21T18:48:53.834094Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"It is unclear whether the \"docked\" bikes are classic, electric, or a mix. Regardless, a greater proportion of casual riders select electric bikes than members do. This supports the idea that casual riders primarily ride for recreaction and more tourist activities. \n\n## Ride Start Time","metadata":{}},{"cell_type":"code","source":"ggplot(data=year_member) +\n  geom_bar(mapping=aes(x=time_of_day, fill=time_of_day), show.legend = FALSE) +\n  labs(title = \"Starting times for Members\", x = \"Time of Day\", y = \"Frequency\") +\n  theme(axis.text.y = element_blank()) + \n  annotate(\"label\", x = \"Night\", y = 56733, label = \"2%\") +\n  annotate(\"label\", x = \"Morning\", y = 909473, label = \"35%\") +\n  annotate(\"label\", \"Afternoon\", y = 1357197, label = \"52%\") +\n  annotate(\"label\", x = \"Evening\", y = 290505, label = \"11%\")","metadata":{"_kg_hide-input":true,"execution":{"iopub.status.busy":"2023-07-21T18:48:53.838664Z","iopub.execute_input":"2023-07-21T18:48:53.841214Z","iopub.status.idle":"2023-07-21T18:48:58.84891Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"ggplot(data=year_casual) +\n  geom_bar(mapping=aes(x=time_of_day, fill=time_of_day), show.legend = FALSE) +\n  labs(title = \"Starting times for Casual Riders\", x = \"Time of Day\", y = \"Frequency\") +\n  theme(axis.text.y = element_blank()) + \n  annotate(\"label\", x = \"Night\", y = 69416, label = \"4%\") +\n  annotate(\"label\", x = \"Morning\", y = 436112, label = \"27%\") +\n  annotate(\"label\", \"Afternoon\", y = 890307, label = \"55%\") +\n  annotate(\"label\", x = \"Evening\", y = 231681, label = \"14%\")","metadata":{"_kg_hide-input":true,"execution":{"iopub.status.busy":"2023-07-21T18:48:58.853482Z","iopub.execute_input":"2023-07-21T18:48:58.85624Z","iopub.status.idle":"2023-07-21T18:49:01.839401Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Riders from both groups follow the same trends in riding start times. Over half of the rides in both groups started in the afternoon.\n\n# Conclusions\n\nThe current goal in the company in too encourage casual riders to transition into Cyclistic Members. Tourists are not likely to become members, as they will not get enough use out of the membership. Locals need to feel it is more cost effective to be a member rather than paying per ride or per day.\n\n## Recommendations\n\nI recommend implementing a pricing structure that has prices that vary based on the day of the week and time of day. The cost for members would be uneffected, and proper implementation will make membership more desirable to repeat casual riders.\n\n1. Weekends are popular ride times for casual riders, therefore I recommend making single ride or day passes more expensive on Fridays, Saturdays, and Sundays.\n\n2. The afternoon is the most popular time to start a ride, therefore I recommend increasing the price for single rides if they start in the afternoon.\n\n3. Casual riders are more likely to take longer rides, therefore I recommend making single rides more expensive if they last greater than an hour.\n\n\nI recognize that recommendation #3 may already be addressed by the existence of day passes, so I have an additional recommendation if necessary.\n\n4. Electric bikes are more commonly selected by casual riders, therefore I recommend having a number of electric bikes reserved for members. This may encourage casual riders to become members in order to gain access to electric bikes.\n\n### Thank You\n\nThank you for taking the time to read my report. Thank you to the Google Data Analytics course for providing me with the tools to accomplish this","metadata":{}}]}